from gradio_client import Client
import requests

# img = '44.png'

def get_from_blip2_api(img):
    client = Client("https://merve-blip2-with-transformers.hf.space/")
    result = client.predict(f"img/{img}", "Beam search",	0.5, -1, 1, api_name="/caption")
    # print(result)
    return result


